"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[1995],{24171:(e,t,i)=>{i.r(t),i.d(t,{default:()=>r,johnChapter21PL:()=>n});const n={chapter:21,title:"Jean 21",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Potem si\u0119 ukaza\u0142 zasi\u0119 Jezus uczniom nad morzem Tyberyjskiem; a ukaza\u0142 si\u0119 tak:",strong:[]},{number:2,text:"Byli pospo\u0142u Szymon Piotr, i Tomasz, kt\xf3ry s\u0142ynie Didymus, i Natanael, kt\xf3ry by\u0142 z Kany Galilejskiej, i synowie Zebedeuszowi, i drudzy z uczni\xf3w jego dwaj.",strong:[{text:"Thomas",strong:"G2381",start:14,end:20},{text:"fils",strong:"G5207",start:72,end:76},{text:"deux",strong:"G1417",start:92,end:96}]},{number:3,text:"Rzek\u0142 im Szymon Piotr: Id\u0119 \u0142owi\u0107 ryb. Rzekli mu: P\xf3jdziemy i my z tob\u0105. Wyszli, i wsiedli natychmiast do \u0142odzi, a onej nocy nic nie z\u0142owili.",strong:[{text:"cher",strong:"G27",start:33,end:37},{text:"avec",strong:"G1848",start:73,end:77},{text:"dans",strong:"H6887",start:110,end:114},{text:"cette",strong:"G3778",start:130,end:135},{text:"nuit",strong:"G3571",start:136,end:140},{text:"rien",strong:"G3762",start:159,end:163}]},{number:4,text:"A gdy ju\u017c by\u0142o rano, stan\u0105\u0142 Jezus na brzegu; wszak\u017ce nie poznali uczniowie, \u017ce by\u0142 Jezus.",strong:[]},{number:5,text:"I rzek\u0142 im Jezus: Dziatki! mam\u017ce\u015bcie co je\u015b\u0107? Odpowiedzieli mu: Nie mamy.",strong:[{text:"rien",strong:"G3762",start:37,end:41}]},{number:6,text:"A on im rzek\u0142: Zarzu\u0107cie sie\u0107 na praw\u0105 stron\u0119 \u0142odzi, a znajdziecie. Tedy zarzucili, a ju\u017c jej wywlec nie mogli dla mn\xf3stwa ryb.",strong:[]},{number:7,text:"Tedy rzek\u0142 on ucze\u0144, kt\xf3rego mi\u0142owa\u0142 Jezus, Piotrowi: Pan jest. A Szymon Piotr, us\u0142yszawszy, \u017ce Pan jest, opasa\u0142 si\u0119 sukni\u0105, (bo by\u0142 nagi,) i wrzuci\u0142 si\u0119 w morze.",strong:[{text:"disciple",strong:"G3101",start:9,end:17},{text:"Seigneur",strong:"G2962",start:58,end:66},{text:"Seigneur",strong:"G2962",start:122,end:130},{text:"dans",strong:"H6887",start:193,end:197}]},{number:8,text:"A drudzy uczniowie \u0142odzi\u0105 przyjechali; (bo nie byli daleko od ziemie, tylko jakoby na dwie\u015bcie \u0142okci,) ci\u0105gn\u0105c on\u0119 sie\u0107 z rybami.",strong:[{text:"avec",strong:"G1848",start:29,end:33},{text:"terre",strong:"H776",start:110,end:115},{text:"deux",strong:"G1417",start:130,end:134}]},{number:9,text:"A skoro wyszli na ziemi\u0119, ujrzeli roz\u017carzone w\u0119gle po\u0142o\u017cone, i ryb\u0119 na nich le\u017c\u0105c\u0105, i chleb.",strong:[{text:"terre",strong:"H776",start:30,end:35},{text:"pain",strong:"G740",start:98,end:102}]},{number:10,text:"Rzek\u0142 im Jezus: Przynie\u015bcie z tych ryb, kt\xf3re\u015bcie teraz z\u0142owili.",strong:[{text:"prendre",strong:"G3880",start:56,end:63}]},{number:11,text:"Wst\u0105pi\u0142 Szymon Piotr, i wywl\xf3k\u0142 on\u0119 sie\u0107 na ziemi\u0119, pe\u0142n\u0105 wielkich ryb, sto pi\u0119\u0107dziesi\u0105t i trzy; a cho\u0107 ich tak wiele by\u0142o, nie rozerwa\u0142a si\u0119 sie\u0107.",strong:[{text:"dans",strong:"H6887",start:19,end:23},{text:"terre",strong:"H776",start:45,end:50}]},{number:12,text:"Rzek\u0142 im Jezus: P\xf3jd\u017acie, obiadujcie. A \u017caden z uczni\xf3w nie \u015bmia\u0142 go pyta\u0107: Ty\u015b ty kto? wiedz\u0105c, \u017ce Pan jest.",strong:[{text:"aucun",strong:"G3762",start:34,end:39},{text:"demander",strong:"G154",start:66,end:74},{text:"Seigneur",strong:"G2962",start:110,end:118}]},{number:13,text:"Tedy przyszed\u0142 Jezus, i wzi\u0105\u0142 chleb, i da\u0142 im, i ryb\u0119 tak\u017ce.",strong:[{text:"pain",strong:"G740",start:26,end:30}]},{number:14,text:"To ju\u017c po trzeci raz ukaza\u0142 si\u0119 Jezus uczniom swoim, gdy by\u0142 wzbudzony z martwych.",strong:[]},{number:15,text:"A gdy obiadowali, rzek\u0142 Szymonowi Piotrowi Jezus: Szymonie Jonasz\xf3w! mi\u0142ujesz li mi\u0119 wi\u0119cej, ni\u017celi ci? Rzek\u0142 mu: Tak, Panie! ty wiesz, \u017ce ci\u0119 mi\u0142uj\u0119. Rzek\u0142 mu: Pa\u015b baranki moje.",strong:[{text:"fils",strong:"G5207",start:60,end:64},{text:"Seigneur",strong:"G2962",start:138,end:146}]},{number:16,text:"Rzek\u0142 mu zasi\u0119 po wt\xf3re: Szymonie Jonasz\xf3w! mi\u0142ujesz li mi\u0119? Rzek\u0142 mu: Tak, Panie! ty wiesz, \u017ce ci\u0119 mi\u0142uj\u0119. Rzek\u0142 mu: Pa\u015b owce moje.",strong:[{text:"fils",strong:"G5207",start:36,end:40},{text:"Seigneur",strong:"G2962",start:89,end:97},{text:"brebis",strong:"G4263",start:146,end:152}]},{number:17,text:"Rzek\u0142 mu po trzecie: Szymonie Jonasz\xf3w! mi\u0142ujesz li mi\u0119? I zasmuci\u0142 si\u0119 Piotr, \u017ce mu po trzecie rzek\u0142: Mi\u0142ujesz li mi\u0119? I rzek\u0142 mu: Panie! ty wiesz wszystko, ty wiesz, \u017ce ci\u0119 mi\u0142uj\u0119. Rzek\u0142 mu Jezus: Pa\u015b owce moje.",strong:[{text:"fils",strong:"G5207",start:42,end:46},{text:"Seigneur",strong:"G2962",start:171,end:179},{text:"brebis",strong:"G4263",start:251,end:257}]},{number:18,text:"Zaprawd\u0119, zaprawd\u0119 powiadam tobie: Gdy\u015b by\u0142 m\u0142odszym, opasywa\u0142e\u015b si\u0119 sam, i chodzi\u0142e\u015b, gdzie\u015b chcia\u0142; ale gdy si\u0119 zstarzejesz, wyci\u0105gniesz r\u0119ce twoje, a inny ci\u0119 opasze, i poprowadzi, k\u0119dyby\u015b nie chcia\u0142.",strong:[]},{number:19,text:"(A to powiedzia\u0142, oznajmuj\u0105c, jak\u0105 by \u015bmierci\u0105 mia\u0142 uczci\u0107 Boga.) A to powiedziawszy, rzek\u0142 mu: P\xf3jd\u017a za mn\u0105.",strong:[{text:"mort",strong:"H6757",start:37,end:41},{text:"Dieu",strong:"G2316",start:62,end:66}]},{number:20,text:"A obr\xf3ciwszy si\u0119 Piotr, ujrza\u0142 ucznia id\u0105cego za sob\u0105, kt\xf3rego mi\u0142owa\u0142 Jezus, kt\xf3ry te\u017c odpoczywa\u0142 na wieczerzy na piersiach jego, i rzek\u0142: Panie! kt\xf3\u017c jest, co ci\u0119 zdradzi?",strong:[{text:"disciple",strong:"G3101",start:49,end:57},{text:"Seigneur",strong:"G2962",start:161,end:169}]},{number:21,text:"Tego ujrzawszy Piotr, rzek\u0142 Jezusowi: Panie! a ten co?",strong:[{text:"Seigneur",strong:"G2962",start:47,end:55}]},{number:22,text:"Rzek\u0142 mu Jezus: Je\u017ali go chc\u0119, aby zosta\u0142, a\u017cbym przyszed\u0142, co tobie do tego? ty p\xf3jd\u017a za mn\u0105.",strong:[{text:"demeure",strong:"H1004",start:32,end:39}]},{number:23,text:"Wysz\u0142a tedy ta mowa mi\u0119dzy braci\u0105, \u017ce on ucze\u0144 nie umrze. Ale mu Jezus nie powiedzia\u0142, \u017ce nie umrze; ale: Je\u017ali go chc\u0119, aby zosta\u0142, a\u017cbym przyszed\u0142, co tobie do tego?",strong:[{text:"disciple",strong:"G3101",start:51,end:59},{text:"demeure",strong:"H1004",start:168,end:175}]},{number:24,text:"Ten jest on ucze\u0144, kt\xf3ry \u015bwiadczy o tem, i kt\xf3ry to napisa\u0142; a wiemy, \u017ce prawdziwe jest \u015bwiadectwo jego.",strong:[{text:"disciple",strong:"G3101",start:9,end:17}]},{number:25,text:"A jestci i wiele innych rzeczy, kt\xf3re czyni\u0142 Jezus, kt\xf3re, by pisane by\u0142y ka\u017cda z osobna, mniemam, \u017ce by i sam \u015bwiat nie pomie\u015bci\u0142 ksi\u0105g, kt\xf3re by napisane by\u0142y. Amen.",strong:[{text:"beaucoup",strong:"G4183",start:20,end:28},{text:"monde",strong:"G2889",start:99,end:104}]}]},r=n}}]);
